import React from 'react'
import logo from './logo.svg';
import ldlogo from './LaunchDarklyImage.png'
import './App.css';
import  { withLDProvider, useFlags } from 'launchdarkly-react-client-sdk';
import Header from './components/header';
//import { LDProvider } from 'react';

function App() {
  const { logoSwicth, footerText, headerText } = useFlags();
  return (
    <div className="App">
      <header className="App-header">
        {
          headerText ? (<Header></Header>) : (<div/>)
        }
        { logoSwicth ? (<img src={ldlogo} className="App-logo" alt="logo" />) :
       ( <img src={logo} className="App-logo" alt="logo" /> )
}
        <p> {footerText} </p>
        {/* <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a> */}
      </header>
    </div>
  );
}

export default withLDProvider({
  clientSideID: process.env.REACT_APP_CLIENT_ID,//'62b79f9293fe561489af4349',
//   user: {
//     "key": "aa0ceb",
